import React from 'react'
import "./comment.css"
const Comment = ({ comment } ) => {
  return (
    <div className='cc'>
      <p>{comment.name}</p>
      <p>{comment.comm}</p>
      <p>{new Date(comment.date)}</p>
    </div>
  )
}

export default Comment
